<p>Скрипт для генерации массива из адресов картинок на основе preload-images.html (предварительно надо его создать по инструкции (см. файл)):
- массив используем для предварительной загрузки картинок с помощью JS.
- окрываем файл в браузере,
- копируем массив в скрипт в index.html</p>

<button onclick="myFunction()">Try it</button>

<div id="demo">
  
</div>

<script>
function myFunction() {
	let img_arr = [];
	//let images = document.images;
	let images = document.getElementsByTagName("img");
	let demo = document.getElementById("demo");	
  let txt = "";
	//1
	/*txt += "[";
	
	for(let i = 0; i < images.length; i++) {
		img_arr.push(images[i].getAttribute("src"));
		txt += "\"" + img_arr[i] + "\"";
		
		if ((i + 1) < images.length)
			txt += ", ";
		//if ((i + 1) % 6 == 0)
			//txt += "<br>";
	}	
	txt += "]";*/
	//2
	for(let i = 0; i < images.length; i++) {
		
		txt += "<img src=\"" + images[i].getAttribute("src") + "\" width=\"1\" height=\"1\"/>";
		
	}	
	
	
  demo.innerText = txt;
}
</script>
